(1162, 172, 'In organic chemistry, a molecule is considered chiral if it:', 'Is non-superimposable on its mirror image.', 'Contains at least one double bond within its structure.', 'Possesses a perfectly planar molecular geometry.', 'Reacts readily with strong acids at room temperature.', 1, 2.00, 'multiple_choice'),
(1163, 172, 'Developed in the mid-1960s by Joseph Weizenbaum, which early natural language processing computer program simulated a Rogerian psychotherapist and famously tricked many users into believing they were conversing with a human?', 'SHRDLU', 'Deep Blue', 'Logic Theorist', 'ELIZA', 4, 2.00, 'multiple_choice'),
(1164, 172, 'What is the primary advantage of using a microcontroller over a microprocessor in applications like embedded systems (e.g., in a washing machine or remote control)?', 'Microprocessors are significantly cheaper and more power-efficient for all tasks.', 'Microcontrollers integrate CPU, memory, and I/O peripherals onto a single chip, making them self-contained and compact.', 'Microprocessors have a much smaller instruction set, simplifying programming for complex operations.', 'Microcontrollers can only perform basic arithmetic operations, while microprocessors handle all complex tasks.', 2, 2.00, 'multiple_choice'),
(1165, 172, 'Characterized by the fragmentation of subjects into geometric shapes and multiple viewpoints within a single picture plane, which influential 20th-century art movement was pioneered by Pablo Picasso and Georges Braque?', 'Surrealism', 'Fauvism', 'Abstract Expressionism', 'Cubism', 4, 2.00, 'multiple_choice'),
