(1188, 175, 'According to Bernoulli\'s principle, how does the pressure of air flowing over the curved upper surface of an airplane wing (airfoil) compare to the pressure of air flowing under the flatter lower surface, contributing to lift?', 'Pressure above is higher, pressure below is lower.', 'Pressure above is lower, pressure below is higher.', 'Pressure is equal both above and below.', 'Pressure differences are negligible; lift is solely due to Newton\'s third law.', 2, 2.00, 'multiple_choice'),
