INSERT INTO `testimonials` (`id`, `name`, `review`, `rating`, `updated_at`, `created_at`) VALUES
(1, 'Rahul Desai, Grade 10\r\n', 'Magic of Skills has made learning so much fun. The interactive lessons and engaging projects have reignited my passion for learning. I look forward to every new course and can‚Äôt wait to see what I‚Äôll learn next.', 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'Aditi Roy, Grade 8', '\"The personal development courses have been a game-changer for me. I‚Äôve learned how to manage my time better and stay organized. These skills are helping me perform better in school and in my daily life.\"', 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 'Priya Singh, Grade 9', '\"Magic of Skills has given me the opportunity to explore different subjects and find my true passion. The variety of courses available is amazing, and the instructors are always encouraging and supportive.\"', 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, 'Krishna Menon, Grade 11', '\"The STEM courses at Magic of Skills are top-notch. The hands-on projects and real-world applications make learning so much more interesting. I‚Äôve even started a robotics club at my school with the skills I‚Äôve gained.\"', 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 'Ananya Gupta, Grade 7', '\"I always wanted to learn French, and Magic of Skills made it possible. The language courses are fun and interactive, and I love practicing with my classmates. I can now speak basic French with confidence!\"', 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 'Rohan Sharma, Grade 12', '\"Preparing for college felt daunting until I joined Magic of Skills. The personal development courses improved my communication and leadership skills, giving me the confidence to excel in interviews and group discussions.\"', 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 'Sneha Kapoor, Grade 8', '\"The art courses at Magic of Skills have helped me explore my creativity like never before. The instructors are so supportive and knowledgeable. I\'ve learned new techniques that I can use in my school projects.\"', 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
