(5, 'How to speak like a star! From Classroom to Stage', 'This workshop is designed to help students transform their communication skills and develop confidence in public speaking. Through engaging activities, students will master pronunciation, enunciation, voice modulation, and stage presence to become powerful speakers.', 9, 2, '1', '‚Å†Improve pronunciation, enunciation, and articulation.<br>\r\nDevelop confidence to speak in front of an audience.<br>\r\nLearn voice modulation and tone control for impact.', 'Enhance communication skills and build confidence in public speaking through engaging activities focused on pronunciation, enunciation, voice modulation, and stage presence.\r\n‚Ä¢‚Å†  ‚Å†Master body language and facial expressions while speaking.<br>\r\n‚Ä¢‚Å†  ‚Å†Overcome stage fear and nervousness.<br>\r\n‚Ä¢‚Å†  ‚Å†Practice structuring speeches and storytelling techniques.', '2030-01-01 05:00:00', 60, 'public/workshop/icon/fmg57IumpmsAcunzC9Tz2dWiKv800CnxFxMASg64.jpg', 'public/workshop/banner_image/QddyrMV6gYw6lNjT2lhFc72tTtIb5D5kPRYIhsoq.jpg', 9999.00, 9999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-03-17 22:20:43', '2025-03-17 22:48:42'),
(6, 'How to speak like a star! From Classroom to Stage', 'This workshop is designed to help students transform their communication skills and develop confidence in public speaking. Through engaging activities, students will master pronunciation, enunciation, voice modulation, and stage presence to become powerful speakers.', 9, 2, '1', 'Improve pronunciation, enunciation, and articulation.<br>\r\n‚Ä¢‚Å†  ‚Å†Develop confidence to speak in front of an audience.<br>\r\n‚Ä¢‚Å†  ‚Å†Learn voice modulation and tone control for impact.<br>', 'Enhance communication skills and build confidence in public speaking through engaging activities focused on pronunciation, enunciation, voice modulation, and stage presence.\r\n‚Ä¢‚Å†  ‚Å†Master body language and facial expressions while speaking.<br>\r\n‚Ä¢‚Å†  ‚Å†Overcome stage fear and nervousness.<br>\r\n‚Ä¢‚Å†  ‚Å†Practice structuring speeches and storytelling techniques.', '2030-01-01 17:00:00', 60, 'public/workshop/icon/E4gflZ0USvBG7WfOVYmmMhEV8hWBZUovzeScNiAx.png', 'public/workshop/banner_image/x7KNjtCTpGK8Uy3sPYNNOPNbUaU5OvNPhpJL5lRg.png', 10000.00, 9999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-03-17 22:22:02', '2025-03-17 22:22:02'),
(7, 'Become a Dynamic Presenter ‚Äì Act, Move, Inspire', 'A great presentation is more than just words‚Äîit‚Äôs about movement, energy, and engagement! This workshop helps students develop the ability to present ideas dynamically using storytelling, expression, and body language to captivate their audience.', 10, 7, '1', '‚Ä¢‚Å†  ‚Å†Learn how to structure and deliver compelling presentations.  <br>\r\n‚Ä¢‚Å†  ‚Å†Overcome nervousness and develop a charismatic stage personality. <br>\r\n‚Ä¢‚Å†  ‚Å†Develop storytelling skills for impactful communication.  <br>\r\n‚Ä¢‚Å†  ‚Å†Build confidence in expressing ideas with enthusiasm.  <br>\r\n‚Ä¢‚Å†  ‚Å†Understand the role of eye contact, posture, and stage presence. <br> \r\n‚Ä¢‚Å†  ‚Å†Overcome nervousness and develop a charismatic stage personality. <br>', 'Master the art of engaging presentations! This workshop helps students enhance their storytelling, body language, and stage presence to captivate audiences with confidence and charisma.<br>', '2030-01-01 17:00:00', 60, 'public/workshop/icon/4TuUEht1k9VvHevD3o8Jgyl4s347JgJAyGuwXWLy.png', 'public/workshop/banner_image/YPxl6xKL7yq3yuZx0OKE9urQ2nsKTaYBd6pi5nRl.png', 998.99, 999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-03-18 12:06:07', '2025-11-16 09:34:54'),
(8, 'From Curious to Creative ‚Äì Create with Generative AI', 'Step into the future of creativity with Generative AI! This hands-on workshop will introduce students to AI tools that can assist in content creation, art, storytelling, and more. They will explore how AI can transform ideas into reality while understanding its ethical implications.', 12, 3, '3', '‚Ä¢‚Å†  ‚Å†Understand the basics of Generative AI and its applications.<br>  \r\n‚Ä¢‚Å†  ‚Å†Experiment with AI-powered tools for text, images, and videos.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Develop creative projects using AI-generated content.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Learn ethical considerations and responsible AI usage.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Enhance problem-solving and critical thinking through AI-driven creation. <br>   \r\n‚Ä¢‚Å†  ‚Å†Gain insights into the future of AI in education and creativity.<br>', 'Unleash creativity with AI! Explore cutting-edge tools for generating text, images, and videos while understanding the ethical side of AI-powered innovation.', '2030-01-01 17:00:00', 59, 'public/workshop/icon/lCokb1A6gqEg5qAUbJvoScovruM0LaQ1pVadHYS2.png', 'public/workshop/banner_image/KPYrqbfkoOPJ2yHGsdtpCTr0OsZCI4n5k5MKNTQx.png', 9999.00, 9999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-03-18 12:14:07', '2025-03-19 12:28:25'),
(9, 'From Curious to Creative ‚Äì Create with Generative AI', 'Step into the future of creativity with Generative AI! This hands-on workshop will introduce students to AI tools that can assist in content creation, art, storytelling, and more. They will explore how AI can transform ideas into reality while understanding its ethical implications.', 12, 3, '1', '‚Ä¢‚Å†  ‚Å†Understand the basics of Generative AI and its applications.<br>  \r\n‚Ä¢‚Å†  ‚Å†Experiment with AI-powered tools for text, images, and videos.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Develop creative projects using AI-generated content.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Learn ethical considerations and responsible AI usage.  <br>  \r\n‚Ä¢‚Å†  ‚Å†Enhance problem-solving and critical thinking through AI-driven creation. <br>   \r\n‚Ä¢‚Å†  ‚Å†Gain insights into the future of AI in education and creativity.<br>', 'Unleash creativity with AI! Explore cutting-edge tools for generating text, images, and videos while understanding the ethical side of AI-powered innovation.', '2030-01-01 17:00:00', 90, 'public/workshop/icon/SCnTuyw7fup58zvqEuieWPzWWl86jMbrVsbSf8F3.webp', 'public/workshop/banner_image/aQrGwp6Wi3czPavPeUN1Sq6hmMe3NDCKuw3dahlB.webp', 9999.00, 9999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-03-19 12:25:59', '2025-03-19 12:25:59'),
(10, 'Learn the Craft of Quizzing', '1-Hour Online Workshop', 1, 5, '1', 'Understand basic quiz formats & rules. <br>\r\nLearn key strategies for answering questions. <br>\r\nPractice clue-spotting and lateral thinking. <br>\r\nExperience a live quiz round with feedback.', '1-Hour Online Workshop', '2025-08-26 17:00:00', 60, 'public/workshop/icon/zwcseZlD8eM48MRMJyc7NyHe70U1khL3EmsIMFGE.png', 'public/workshop/banner_image/9WHWEO3K87VVF3hVbCiowCfKdWd33muwlrwb8Nv1.png', 1499.00, 999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-08-19 20:54:38', '2025-08-19 20:54:38'),
(11, 'Learn The Craft Of Quizzing', 'Quizzing is not just about knowing facts ‚Äî it is about thinking critically, making quick connections, and applying knowledge creatively.\r\nIn this exclusive 1-hour online workshop, students will explore the real craft behind quizzing with expert quizmaster Mr. Gaurava Yadav, a renowned national quiz champion.\r\n\r\nThis session is perfect for students preparing for inter-school quizzes, competitions, and national-level events like Quest. The workshop focuses on techniques that help learners improve memory, build curiosity, structure knowledge, and develop a sharp quizzing instinct.\r\nPacked with interactive activities, demonstrations, and insider tips, this workshop gives students a strong foundation to start or strengthen their quizzing journey.', 1, 10, '1', 'Understanding the Basics of Competitive Quizzing\r\nHow quizzes work, types of rounds, formats, and scoring patterns.<br>\r\n\r\nStrategies to Improve Question Interpretation\r\nTechniques to break down and decode questions quickly.<br>\r\n\r\nMemory & Recall Techniques for Quizzers\r\nTips to retain facts, concepts, and current affairs effectively.<br>\r\n\r\nBuilding a Habit of Smart Learning\r\nHow to structure your daily learning to stay quiz-ready.<br>\r\n\r\nTips from a National Quiz Champion\r\nPractical insights, preparation methods, and last-minute strategies shared by Mr. Gaurava Yadav.<br>\r\n\r\nBoosting Confidence & On-Stage Presence\r\nHow to handle pressure, buzzers, and time-bound answering.<br>', 'A power-packed 1-hour online workshop designed to introduce students to the strategy behind competitive quizzing. Led by national quiz champion Mr. Gaurava Yadav, this session equips learners with the right tools to think faster, recall better, and quiz smarter.', '2025-11-29 18:00:00', 60, 'public/workshop/icon/CqmjIgeeCJ1b4flKCYaBpyeNeeATP46qD4ucfpaG.jpg', 'public/workshop/banner_image/TeArP6W7WoSYL8zsQuMAEkStsqFLfHrHgYveKczm.jpg', 0.00, 999.00, 199.00, NULL, NULL, 0, 0, 1, 1, '2025-11-16 09:25:50', '2025-11-16 09:39:09'),
(12, 'Learn The Craft Of Quizzing', 'Quizzing is not just about knowing facts; it is about thinking critically, making quick connections, and applying knowledge creatively.\r\nIn this exclusive 1-hour online workshop, students will delve into the art of crafting quizzes with expert quizmaster Mr. Gaurava Yadav, a renowned national quiz champion.\r\nThis session is ideal for students preparing for inter-school quizzes, competitions, and national-level events, such as Quest. The workshop focuses on techniques that help learners improve memory, build curiosity, structure knowledge, and develop a sharp quizzing instinct.\r\nPacked with interactive activities, demonstrations, and insider tips, this workshop gives students a strong foundation to start or strengthen their quizzing journey.', 1, 10, '1', 'Understanding the Basics of Competitive Quizzing.<br>\r\nStrategies to Improve Question Interpretation.<br>\r\nTechniques to break down and decode questions quickly.<br>\r\nMemory & Recall Techniques for Quizzers.<br>\r\nBuilding a Habit of Smart Learning.<br>\r\nTips from a National Quiz Champion.<br>\r\nBoosting Confidence & On-Stage Presence.<br>', 'A fast-paced, engaging session that gives students a real feel of competitive quizzing and how champions approach it. Designed to spark curiosity, build confidence, and set the right mindset for excelling in quizzes.', '2026-01-17 17:00:00', 60, 'public/workshop/icon/UP9PrYb9P1ejtS88tVNHBWqFZlHIPQklY1TqA4ED.jpg', 'public/workshop/banner_image/Ba6LAItMy2scETvs9JtAMz5qCyIzfo3l1pZZWWe2.jpg', 699.00, 499.00, 199.00, NULL, NULL, 1, 0, 1, 0, '2025-11-20 12:49:12', '2026-01-08 15:32:48'),
(13, 'Design Your Thinking', 'Design Your Thinking is a creative, student-centric workshop that helps learners develop structured thinking, curiosity, and problem-solving skills. Through engaging activities and relatable examples, students learn how to approach challenges with an open mind, explore multiple ideas, and think logically before jumping to solutions.\r\nThe workshop introduces students to the basics of design thinking in a simple, age-appropriate manner, encouraging creativity, empathy, and thoughtful decision-making. It is ideal for parents and teachers who want children to become confident thinkers, not just quick answer-givers.', 13, 10, '1', 'Think creatively and logically when faced with problems.<br>\r\nUnderstand how to break big problems into smaller parts.<br>\r\nExplore multiple ideas before choosing a solution.<br>\r\nDevelop curiosity, observation, and questioning skills.<br>\r\nApply structured thinking in academics and daily life.<br>\r\nBuild confidence in sharing and refining ideas.', 'A creative thinking workshop for students that builds problem-solving, curiosity, and structured thinking through engaging activities. By the end of this workshop, students will be able to:', '2026-01-31 17:00:00', 60, 'public/workshop/icon/CBc42cpxONj8gb5Dem77oxFxLrkEDeharfp7Ckyo.png', 'public/workshop/banner_image/0P8fHRG5AJV7SGdUWA0fubuwA4aBmA5KaiD3Ob7n.png', 699.00, 499.00, 199.00, NULL, NULL, 1, 0, 1, 0, '2026-01-01 13:40:59', '2026-01-02 13:51:13'),
(14, 'Turning Ideas into Outcomes', 'Turning Ideas into Outcomes is a practical skill-building workshop designed to help students learn how to convert ideas into clear actions and meaningful results. While many students have ideas, this workshop teaches them how to plan, organize, and execute those ideas step by step.\r\nUsing simple frameworks and student-friendly examples, learners understand the importance of goal-setting, decision-making, and follow-through. The session encourages responsibility, perseverance, and clarity.', 13, 10, '1', 'Turn ideas into actionable steps.<br>\r\nSet simple, achievable goals.<br>\r\nPlan tasks and manage time effectively.<br>\r\nUnderstand the importance of execution and consistency.<br>\r\nTake responsibility for completing tasks.<br>\r\nBuild confidence in completing projects and assignments.', 'This session sets the foundation for purposeful planning and thoughtful execution in both academic and personal contexts. By the end of this workshop, students will be able to:', '2026-02-14 17:00:00', 60, 'public/workshop/icon/2P5svhaZCGZQuqnBLW9XQ4kCWYL0ayrXQLnKWny9.png', 'public/workshop/banner_image/WaLkgz0XQBawPqYpzqHmCDbDjWh30Z4WNHjQMDVh.png', 699.00, 499.00, 199.00, NULL, NULL, 0, 0, 1, 0, '2026-01-01 14:34:38', '2026-01-02 13:56:22'),
(15, 'Communicating with Confidence', 'Communicating with Confidence is a student-focused skill-building workshop designed to help learners express their thoughts clearly, confidently, and respectfully. The session focuses on building strong communication foundations through age-appropriate activities, real-life examples, and guided practice.\r\nStudents will learn how to speak without fear, listen actively, and present their ideas with clarity, whether in classrooms, group discussions, presentations, or everyday interactions. The workshop is ideal for parents and teachers looking to nurture their children with essential life skills that support academic success and personal growth.', 14, 7, '1', 'Communicate their ideas with greater clarity and confidence<br>\r\nOvercome hesitation and fear while speaking<br>\r\nImprove listening and response skills<br>\r\nUse appropriate body language and tone<br>\r\nParticipate actively in class discussions and group activities<br>\r\nBuild self-confidence for academic and social settings', 'An engaging communication skills workshop for students to build confidence, clarity, and effective expression through interactive learning. By the end of this workshop, students will be able to:', '2026-02-28 17:00:00', 60, 'public/workshop/icon/0aZ8eqe75m0KvgYAoW7KWgJKGps8Hqoq5LSmeDw5.png', 'public/workshop/banner_image/vJCg1wpvSf5f1easQsSzIRsw1lpOYmPp8da24ky7.png', 699.00, 499.00, 199.00, NULL, NULL, 0, 0, 1, 0, '2026-01-01 22:09:00', '2026-01-02 14:05:40');
